import classes from "./UserList.module.css"

const UserList=(props)=>{
    return(
        <div className={classes.users}>
            <ul>
                <li className={classes.users}></li>
            </ul>
            {props.userInputs.UserName} , {props.userInputs.Age}
        </div>
    )
}
export default UserList;
